(1, 1, 1, 'Opcje dostawy', 'Opcje dostawy', 'Opcje dostawy', 'conditions, delivery, delay, shipment, pack', '<h2>Shipments and returns</h2><h3>Your pack shipment</h3><p>Packages are generally dispatched within 2 days after receipt of payment and are shipped via UPS with tracking and drop-off without signature. If you prefer delivery by UPS Extra with required signature, an additional cost will be applied, so please contact us before choosing this method. Whichever shipment choice you make, we will provide you with a link to track your package online.</p><p>Shipping fees include handling and packing fees as well as postage costs. Handling fees are fixed, whereas transport fees vary according to total weight of the shipment. We advise you to group your items in one order. We cannot group two distinct orders placed separately, and shipping fees will apply to each of them. Your package will be dispatched at your own risk, but special care is taken to protect fragile objects.<br /><br />Boxes are amply sized and your items are well-protected.</p>', 'opcje-dostawy'),
(1, 2, 1, 'Opcje dostawy', 'Opcje dostawy', 'Opcje dostawy', 'Dostawa', '<h1 class=\"has-text-weight-bold\" style=\"font-size:1.875rem;margin:0px;font-family:Lato, Helvetica, Arial, sans-serif;color:#2c3238;line-height:1.2;\">Czas i koszty dostawy</h1>\n<p></p>\n<p></p>\n<p></p>\n<p><strong>Darmowa dostawa od kwoty 1000PLN</strong></p>\n<p><br /><strong>Zamówienia złożone do 20:00 wysyłamy tego samego dnia*.(Tylko Kurier DHL)</strong></p>\n<p><em>*Zastrzegamy sobie prawo do wydłużenia czasu realizacji wysyłej w przypadku nagłego wzrostu ilości zamówień.</em></p>\n<p></p>\n<p></p>\n<p></p>\n<p><strong>30 dni na zwrot, bądź wymianę towaru.</strong></p>\n<p></p>\n<table width=\"630\" style=\"height:71px;\">\n<tbody>\n<tr>\n<td><strong>Rodzaj dostawy</strong></td>\n<td><strong>Czas realizacji</strong></td>\n<td><strong>Koszt</strong></td>\n</tr>\n<tr>\n<td>Odbiór osobisty</td>\n<td>do 2h</td>\n<td>0 pln</td>\n</tr>\n<tr>\n<td>Kurier DHL</td>\n<td>1-2 dni robocze</td>\n<td>14.76 pln</td>\n</tr>\n<tr>\n<td>Kurier DPD</td>\n<td>2-4 dni robocze</td>\n<td>9.99 pln</td>\n</tr>\n</tbody>\n</table>\n<p></p>', 'opcje-dostawy'),
(2, 1, 1, 'Legal Notice', NULL, 'Legal notice', 'notice, legal, credits', '<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Online store was created using <a href=\"http://www.prestashop.com\">Prestashop Shopping Cart Software</a>,check out PrestaShop\'s <a href=\"http://www.prestashop.com/blog/en/\">ecommerce blog</a> for news and advices about selling online and running your ecommerce website.</p>', 'legal-notice'),
(2, 2, 1, 'Legal Notice', NULL, 'Legal notice', 'notice, legal, credits', '<h2>Legal</h2><h3>Credits</h3><p>Concept and production:</p><p>This Web site was created using <a href=\"http://www.prestashop.com\">PrestaShop</a>&trade; open-source software.</p>', 'legal-notice'),
(3, 1, 1, 'Terms and conditions of use', NULL, 'Our terms and conditions of use', 'conditions, terms, use, sell', '<h1 class=\"page-heading\">Terms and conditions of use</h1>\n<h3 class=\"page-subheading\">Rule 1</h3>\n<p class=\"bottom-indent\">Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum.</p>\n<h3 class=\"page-subheading\">Rule 2</h3>\n<p class=\"bottom-indent\">Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam&#1102;</p>\n<h3 class=\"page-subheading\">Rule 3</h3>\n<p class=\"bottom-indent\">Tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo consequat. Duis aute irure dolor in reprehenderit in voluptate velit esse cillum dolore eu fugiat nulla pariatur. Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam&#1102;</p>', 'terms-and-conditions-of-use'),
