(4, 1, 1, 'About us', NULL, 'Learn more about us', 'about us, informations', '<h1 class=\"page-heading bottom-indent\">O nas</h1>\n<h1 class=\"page-heading bottom-indent\"><strong class=\"dark\">Nasza firma</strong></h1>\n<h1 class=\"page-heading bottom-indent\"><strong class=\"dark\">Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididun.</strong></h1>\n<div class=\"row\">\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-block\">\n<p>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam. Lorem ipsum dolor sit amet conse ctetur adipisicing elit.</p>\n<ul class=\"list-1\">\n<li><em class=\"icon-ok\"></em>Top quality products</li>\n<li><em class=\"icon-ok\"></em>Best customer service</li>\n<li><em class=\"icon-ok\"></em>30-days money back guarantee</li>\n</ul>\n</div>\n</div>\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-box\">\n<h3 class=\"page-subheading\">Our team</h3>\n<img title=\"cms-img\" src=\"../img/cms/cms-img.jpg\" alt=\"cms-img\" width=\"370\" height=\"192\" />\n<p><strong class=\"dark\">Lorem set sint occaecat cupidatat non </strong></p>\n<p>Eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris nisi ut aliquip ex ea commodo.</p>\n</div>\n</div>\n<div class=\"col-xs-12 col-sm-4\">\n<div class=\"cms-box\">\n<h3 class=\"page-subheading\">Testimonials</h3>\n<div class=\"testimonials\">\n<div class=\"inner\"><span class=\"before\">“</span>Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim.<span class=\"after\">”</span></div>\n</div>\n<p><strong class=\"dark\">Lorem ipsum dolor sit</strong></p>\n<div class=\"testimonials\">\n<div class=\"inner\"><span class=\"before\">“</span>Excepteur sint occaecat cupidatat non proident, sunt in culpa qui officia deserunt mollit anim id est laborum. Lorem ipsum dolor sit amet conse ctetur adipisicing elit. Lorem ipsum dolor sit amet conse ctetur adipisicing elit, sed do eiusmod.<span class=\"after\">”</span></div>\n</div>\n<p><strong class=\"dark\">Ipsum dolor sit</strong></p>\n</div>\n</div>\n</div>', 'about-us'),
(4, 2, 1, 'O nas', 'O nas', 'Dowiedz się o nas', 'O nas', '<div id=\"content\" class=\"site-content\" style=\"font-style:inherit;font-weight:inherit;border:0px;font-size:15px;margin:0px;padding:0px;vertical-align:baseline;\">\n<div class=\"ast-container\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px auto;padding:0px 20px;vertical-align:baseline;max-width:1240px;\">\n<div class=\"elementor elementor-14\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;\">\n<div class=\"elementor-inner\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;\">\n<div class=\"elementor-section-wrap\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;\">\n<div class=\"elementor-container elementor-column-gap-default\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px auto;padding:0px;vertical-align:baseline;max-width:1200px;\">\n<div class=\"elementor-row\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;width:1200px;\">\n<div class=\"elementor-element elementor-element-891e512 animated-slow elementor-column elementor-col-100 elementor-top-column animated fadeInDown\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;min-height:1px;width:1200px;\">\n<div class=\"elementor-column-wrap elementor-element-populated\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:10px;vertical-align:baseline;width:1200px;\">\n<div class=\"elementor-widget-wrap\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;width:1180px;\">\n<div class=\"elementor-element elementor-element-62408b2 elementor-widget elementor-widget-text-editor\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;width:1180px;\">\n<div class=\"elementor-widget-container\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px 0px 50px;vertical-align:baseline;\">\n<div class=\"elementor-text-editor elementor-clearfix\" style=\"border:0px;font-style:inherit;font-weight:inherit;margin:0px;padding:0px;vertical-align:baseline;\">\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:bold;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Jesteśmy energiczną, prężną firmą, która specjalizuje się w kursach programowania.</span></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Posiadamy bogate </span><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:bold;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">10-letnie doświadczenie</span><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">, które sprawiło, że jesteśmy w stanie sprostać wszelkim </span></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">wymaganiom stawianym przez klientów.</span></p>\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><b id=\"docs-internal-guid-51fe4e08-7fff-14b5-f96b-4931a9123502\" style=\"font-style:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;color:#000000;font-weight:normal;\"> </b></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Nasze kursy trafiają zarówno na rynek polski, jak i zagraniczny w szczególności</span></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">niemiecki co napawa nas dumą, ale i skłania do nieustannego rozwoju w tej dziedzinie.</span></p>\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><b style=\"font-style:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;color:#000000;font-weight:normal;\"> </b></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Aby te słowa nie były, bez pokrycia informujemy, iż współpracujemy z jednym z liderów </span></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">na rynku e-kursów, co pozwoliło nam zbudować bogatą bazę doświadczeń, którą chcemy podzielić się z nowym kontrahentem.</span></p>\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><b style=\"font-style:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;color:#000000;font-weight:normal;\"> </b></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Kolejnym naszym niewątpliwym atutem jest kompleksowa obsługa zamówienia tj. od przyjęcia zamówienia do </span></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:400;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">dostarczenia gotowych kursów pod przysłowiowe drzwi.</span></p>\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"><b style=\"font-style:normal;letter-spacing:normal;text-indent:0px;text-transform:none;white-space:normal;word-spacing:0px;text-decoration:none;color:#000000;font-weight:normal;\"> </b></p>\n<p dir=\"ltr\" style=\"line-height:1.2;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size:11.5pt;font-family:Verdana;color:#000000;background-color:transparent;font-weight:bold;font-style:normal;text-decoration:none;vertical-align:baseline;white-space:pre-wrap;\">Tak więc nasz klient jest pod pełną opieką.</span></p>\n<p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:20pt;\"></p>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>\n</div>', 'o-nas'),
