(6, 1, 1, 'Python', NULL, NULL, NULL, NULL, 'python'),
(6, 2, 1, 'Python', 'Python', 'Python', 'Python', '<p style=\"margin:0px 0px 1.5rem;color:#1a1a1a;\">W dobie internetu i rozwiniętych programów komputerowych bardzo ważny jest ciągły rozwój technik programowania. Istnieje wiele języków do tego służących. Niektóre nadają się szczególnie do określonych zadań. Jednym z nich jest język programowania Python.</p>\n<p style=\"margin:0px 0px 1.5rem;color:#1a1a1a;\"><strong>Co to jest Python?</strong><br />Python to obiektowy język programistyczny, który wyróżnia się dynamiką, łatwością w nauce i wielością możliwości wykorzystania. Ideą przewodnią, która przyświecała jego twórcom, była chęć zapewnienia czytelności kodu źródłowego. Właśnie dlatego składnia języka programowania Python wyróżnia się klarownością i zwięzłością. Jego interpretery są dostępne na wiele systemów operacyjnych. Python rozwijany jest na otwartej licencji przez Python Software Foundation, która jest organizacją non-profit. Standardowa implementacja języka to CPython (napisany w języku programowania C). </p>\n<p style=\"margin:0px 0px 1.5rem;color:#1a1a1a;\"><strong>Kto korzysta z Pythona?</strong><br />Mimo obco brzmiącej nazwy, Python jest powszechnie wykorzystywany w serwisach, aplikacjach czy programach, z których korzystamy na co dzień. Dla przykładu popularny YouTube został w większości napisany w Pythonie. Wybór języka został dokonany ze względu na potrzebę zapewnienia dużej wydajności, a także łatwej implementacji najnowszych funkcjonalności. Z Pythona korzysta również w swoich aplikacjach Google. Mowa tu o takich aplikacjach jak chociażby Google App Engine czy Google Wave. Warto również wspomnieć o wykorzystaniu Pythona przez NASA. Aplikacje napisane w tym języku stosowane są chociażby do zarządzania kontrolą startową wahadłowców. Python jest też wykorzystywany przez Nokię, a także w połączeniu z innymi językami i technologiami. </p>\n<p style=\"margin:0px 0px 1.5rem;color:#1a1a1a;\"><strong>Do czego można użyć języka programowania Python?</strong><br />Python posiada bardzo szerokie możliwości wykorzystania. Z jego pomocą można tworzyć zarówno serwisy internetowe, jak i aplikacje komputerowe czy sieciowe, a nawet gry. Python pozwala na tworzenie dynamicznych stron internetowych w prosty sposób. Język jest bardzo efektywny. Duża w tym zasługa frameworków takich jak jak Django czy Pylons. Właśnie dlatego korzysta się z niego głównie przy tworzeniu stron, które są bogate w różnego rodzaju funkcje.</p>\n<p style=\"margin:0px 0px 1.5rem;color:#1a1a1a;\">Za pomocą Pythona można chociażby wykorzystać API (interfejs programowania aplikacji/usługi) serwisu takiego jak Facebook. Dla przykładu wykorzystanie biblioteki PyFacebook pozwala na nieskomplikowane tworzenie aplikacji dla tego portalu. Skrypty i aplikacje napisane w Pythonie znajdują również zastosowanie w nauce czy finansach, gdy potrzebne jest generowanie wykresów lub przetwarzanie danych. Język sprawdzi się również świetnie w przypadku gier i aplikacji wykorzystujących technologię 3D. Często udostępnia się w Pythonie Interfejs Oprogramowania Aplikacji silnika gry napisanego w C lub C++. Jako przykład udanego efektu takich prób można podać chociażby Świątynię Pierwotnego Zła. Wyżej została już wspomniana platforma Google App Engine, którą stworzono dla rozproszonego hostingu aplikacji. Ją również oparto na Pythonie. Dzięki temu Google App Engine może zaoferować serwisom www taką skalowalność, jaką posiadają wszystkie inne usługi i aplikacje tej firmy. </p>', 'python'),
(7, 1, 1, 'C++', NULL, NULL, NULL, NULL, 'cpp'),
(7, 2, 1, 'C++', 'C++', 'C++', 'C++', '<p><strong>Zastosowanie</strong></p>\n<p>C++ to język ogólnego zastosowania. Programy w C++ mogą być napisane tak, aby były wieloplatformowe bez żadnych modyfikacji, ale tylko, gdy trzymamy się odpowiednich zasad. Niektóre właściwości/biblioteki są dla specyficznych systemów.</p>\n<p>C++ jest najczęściej stosowany w systemach wbudowanych oraz w game devie. W C++ napisane zostały systemy operacyjne (lub ich części) takie jak Apple OS X,IBM OS/400, Windows NT, XP, Vista, 7. Jednak zastosowanie C++ jest dużo szersze, głównie tam, gdzie stawia się na wydajność oprogramowania, od aplikacji desktopowych (m.in. produkty Adobe np. Photoshop, Acrobat czy pakiety biurowe Office) przez serwery (m.in. e-commerce np. Amazon, Ebay; wyszukiwarki np. Chrome; baz danych np. MongoDB) po silniki gier AAA lub ich części (np. CryEngine, Unity, Unreal Engine).</p>\n<p>Ogólnie rzecz biorąc, C++ znajduje zastosowanie tam, gdzie liczy się wydajność oraz niskie zużycie zasobów.</p>\n<p>C++ używany jest w największych światowych korporacjach m.in.: Adobe, Facebook, Amazon, Ericsson, HP, IBM, Intel.</p>\n<p><strong></strong></p>\n<p><strong>Poziom skomplikowania</strong></p>\n<p>C++ to język dużo bardziej złożony niż inne języki programowania. Jego semantyka może się wydawać nieco mniej przyjazna dla początkujących. Trzeba też zrozumieć dużo więcej aspektów niż w językach o wyższym poziomie abstrakcji. Należy do nich m.in. zarządzanie pamięcią.</p>\n<p>C++ zakłada statyczną kontrolę typów, ale pozwala także na ich automatyczną dedukcję.</p>\n<p>Dzięki tym właściwościom C++ daję większą kontrolę nad programem, jest bardziej jednoznaczny i umożliwia dostęp do bardziej niskopoziomowych funkcji, co jest szczególnie ważne w dziedzinach, w których znajduje zastosowanie.</p>\n<p>Często mówi się o wskaźnikach, że są trudne dla początkujących, jednak nie powinieneś się ich bać. To nie jest rocket science. W C++ też istnieją inteligentne wskaźniki (są zalecaną praktyką), które same usuwają się wraz z końcem swojego zasięgu, zapobiegając wyciekom pamięci. Surowe wskaźniki są używane tylko w specyficznych sytuacjach.</p>\n<p>O C++ krąży wiele mitów i twierdzeń, które są już zaszłością, a były prawdziwe przed C++11.</p>\n<p>Można zauważyć, że C++ jest często polecanym językiem na początek, na zasadzie, że jak poznasz wszystkie koncepty programowania w C++ to już żaden inny język nie sprawi Ci problemu. Jednak jest to język bardzo złożony i dla nowicjuszy może być przytłaczający. Zaczynając z C++ bardzo łatwo jest się sparzyć, dlatego jeśli nie masz konkretnego powodu, dla którego chcesz uczyć się języka C++, warto zacząć z językami bardziej przyjaznymi dla początkujących jak np. Python. C++ to nieco trudniejsza i dłuższa droga na początek.</p>\n<p></p>\n<p><strong>Przyszłość języka</strong></p>\n<p>Lata świetności C++ z 2003 roku już dawno minęły i można powiedzieć, że C++ staję się coraz bardziej niszowym językiem. Jednak wraz z rozwojem technologii VR (Virtual Reality), w której C++ jest przodującym językiem, znów zyskuje na popularności. C++ jest co jakiś czas nadal ulepszany, mimo że powstał w 1985 roku. C++ nie należy do najpopularniejszych, ale tam, gdzie liczy się wydajność, jest często wybierany i nie zapowiada się, żeby się to zmieniło w najbliższym czasie. Ostatnia jego wersja C++17 wyszła 1 grudnia 2017 po trzyletniej przerwie. C++20 jest kolejną planowaną wersją, więc prawdopodobnie zobaczymy ją w 2020 roku.</p>\n<p></p>', 'cpp'),
(8, 1, 1, 'Swift', NULL, NULL, NULL, NULL, 'swift'),
(8, 2, 1, 'Swift', 'Swift', 'Swift', 'Swift', '<p><strong>Zastosowanie</strong></p>\n<p>Swift jest językiem programowania ogólnego zastosowania stworzonym przez Apple w 2014 roku, więc jest całkiem świeży. Jest następcą Objective-C. Apple obniżyło barierę wejścia dla programistów. Nowy język jest tym, do czego przyzwyczajeni są młodsi programiści, z wysokopoziomowymi strukturami wbudowanymi w język i wieloma ułatwieniami.</p>\n<p>Służy głównie do tworzenia aplikacji na iOS i Mac OS.</p>\n<p></p>\n<p><strong>Poziom skomplikowania</strong></p>\n<p>Swift został zaprojektowany tak, aby był bardziej odporny na błędy oraz bardziej zwięzły niż jego poprzednik Objective-C. Swift wzorował się na prostocie takich języków jak Python czy Ruby, więc jest przyjazny dla młodych programistów. Jego kod można czytać jak zwykły tekst po angielsku.</p>\n<p>Nie musimy deklarować typów przy inicjalizacji zmiennych. Jest też elastyczny, jeśli chodzi o typy, np. metoda może zwracać wiele typów wartości równocześnie, co nie jest możliwe w takich językach jak Java, C# czy C++.</p>\n<p>Swift zajmuje się za nas także zarządzaniem pamięcią.</p>\n<p>Ogólnie rzecz biorąc, Swift jest przyjazny dla początkujących programistów.</p>\n<p><strong></strong></p>\n<p><strong>Przyszłość języka</strong></p>\n<p>Swift dopiero się rozwija, ale udaje mu się wyprzeć Objective-C. Dlatego zapotrzebowanie na programistów Swift będzie się z roku na rok zwiększać. Swift jest jednym z najszybciej rozwijającym się języków. Jego przyszłość głównie zależy od Apple, która wydaję się całkiem przejrzysta. Ma wszystko to, co nowoczesny język programowania powinien mieć i ma potencjał na konkurowanie z najlepszymi. Jego ostatnia wersja 5.3 została wydana 16 września 2020.</p>\n<p></p>', 'swift');
